$(document).ready(function(){var o=$(".content");$.ajax({type:"GET",url:"js/data.json",success:function(a){var s="";for(var t in a)s+='<section class="component book-component__book-item"><a href="'+a[t].url+'" class="book__link"><div class="book__wrapper"><div class="book__image"><img src='+a[t].image+' /></div><div class="book__content"><h5 class="book__title">'+a[t].title+'</h5><span class="book__author">'+a[t].author+"</span></div></div></a></section>";o.html(s)}})});